from sympy import isprime
from itertools import count, islice
def agen():
    aset, mink = set(), 1
    for n in count(1):
        s, k = str(n), mink
        while k in aset or not isprime(int(s + str(k))): k += 1
        while mink%5 == 0 or mink in aset: mink += 2
        yield k; aset.add(k)
